http://en.wikipedia.org/wiki/Beyond!&lt;/a&gt;

The plot of this mini is simple and classic - a group of ill-paired superheroes must join forces to combat a cosmic force that wants to crush them. Written by Dwayne McDuffie with art by Scott Kolins, it is more or less exactly what you'd expect and delivers lots of action (and a few laughs). These nice and new digital copies are by AnPymHero-Empire, so thanks to them. Please seed, enjoy! :-)
